import React, { useState } from "react"
import {
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  Input,
  Button,
  CircularProgress,
  Grid,
} from "@material-ui/core"
import "react-dropzone-uploader/dist/styles.css"
import { useMutation, gql, useQuery } from "@apollo/client"
import { makeStyles } from "@material-ui/core/styles"
import NoteCard from "./NoteCard"

const GET_NOTES = gql`
  subscription getNotes {
    notes_notes {
      content
    }
  }
`

const ADD_NOTES = gql`
  mutation addNotes($content: String) {
    insert_notes_notes_one(
      object: { content: $content, created_on: "NOW()", updated_at: "NOW()" }
    ) {
      id
      content
      created_on
      updated_at
    }
  }
`

const DELETE_NOTES = gql`
  mutation deleteNote($id: Int!) {
    delete_notes_notes_by_pk(id: $id) {
      id
    }
  }
`

const useStyles = makeStyles((theme) => {
  root: {
  }
})

const Notes = () => {
  const classes = useStyles()
  const { data, loading, error } = useSubscription(GET_NOTES)
  const [addNote] = useMutation(ADD_NOTES)
  const [deleteNote] = useMutation(DELETE_NOTES)
  if (loading) return "Loading"
  if (error) return "Error"
  return <div>Test</div>
}

export default Notes
